column3:
{pageend:You can view each other’s Trainer Cards.}
Don’t you wonder what sort of adventures other
players are having?

{pageend:Many different people come here.}
It’s a great opportunity to talk to everyone,
battle them, and improve your skills as a Trainer!

It appears that you are not currently a
{pageend:Nintendo Switch Online member.}
A paid Nintendo Switch Online membership is
{pageend:required to use the Global Club.}
Please try to access the Global Club again if you
become a Nintendo Switch Online member.

{pageend:Welcome to the Pokémon Local Club!}
This is the reception desk for the Local Room.
May I help you with anything?

{pageend:You can copy each other’s Capsule Decorations.}
Place the Capsule Decoration you want to show
{pageend:off at the top of the list.}
The other Trainer’s Capsule Decorations will be
{pageend:automatically copied to your list.}
Even if you don’t have all the same Stickers when
you make the copy, you can do it with just the
ones you already own. Go ahead and try it out!

{tag:0} wants to show you their
{pageend:Capsule Decoration.}
Would you like to show yours to them?

{pageend:Welcome to the Local Room!}
Please enjoy trading Pokémon with a lot
of people!
